DECLARE
BEGIN
	-- insert IATA codes not in wikipedia's list
	-- http://en.wikipedia.org/wiki/Ercan_International_Airport
		VALUES (location_id_seq.nextval, 1, 'ECN', 'LCEN - Ercan International Airport, Tymvou, Northern Cyprus', 35.1597, 33.5000, 'cy');
	
	-- update airports with long/lat from postcode.airport
	FOR r IN (
		SELECT code, longitude, latitude, country
		  FROM postcode.airport
	)
	LOOP
		UPDATE csr.location
		   SET longitude = r.longitude, latitude = r.latitude, country = r.country
		 WHERE name = r.code;
	END LOOP;
	
	-- insert the rest of postcode.airport
	FOR r IN (
		SELECT a.code, a.name, a.city, a.latitude, a.longitude, a.country
		  FROM postcode.airport a
		  LEFT JOIN location l ON a.code = l.name
		 WHERE l.location_id IS NULL
		   AND a.latitude != 0
	)
	LOOP
			VALUES (location_id_seq.nextval, 1, r.code, r.name || ', ' || r.city, r.longitude, r.latitude, r.country);
	END LOOP;
	
	-- insert custom locations
	-- use lat/long from Philips, and guess a name for the airport
	-- the lat/long definately doesn't match with the name of the airport
	
	-- update codes not in postcode.airport
